            "materialId": 7,
            "materialName": "Что такое ViewModel?",
            "materialText": "<p>Согласно официальной документации Android, класс ViewModel является компонентом, что предназначен для хранения и управления данными, связанными с пользовательским интерфейсом и живущими в пределах жизненного цикла приложения. <strong>ViewModel</strong> помогает организовать довольно удобную архитектуру прилож<strong>ения, глобально отделяя две сущности - бизнес-логику от пользовательского интерфейса</strong>, это обусловлено тем, что жизненный цикл <strong>ViewModel</strong>, никак не зависит от <strong>Activity</strong> или <strong>Fragment'а</strong>, что позволяет сохранять данные, даже в момент пересоздания <strong>Activity</strong>, допустим при том же  повороте экрана или других изменениях конфигурации устройства.</p>",
