        {
            "materialId": 8,
            "materialName": "Что такое LiveData?",
            "materialText": "<p>LiveData – это класс, основной задачей которого является хранение данных с целью реализации паттерна Observable. LiveData входит в набор компонентов Android Jetpack.</p><p>Преимущество <strong>LiveData</strong> перед другими реализациями <strong>шаблона &quot;Наблюдателя&quot;</strong> в том, что <strong>LiveData</strong> заточена на работу с жизненными циклами Android компонентов, таких как <strong>Activity</strong>, <strong>Fragment</strong>, <strong>Service</strong>.</p><p>Для подписки на обновления <strong>LiveData</strong> используется метод <strong>observe()</strong>, который принимает объект типа <strong>LifecycleOwner</strong> и функциональный интерфейс <strong>Observer</strong>.</p><p>Интерфейс <strong>LifecycleOwner</strong> реализуется классами <strong>Android-компонентов</strong>, например <strong>AppCompatActivity</strong>, <strong>LifecycleService</strong>, <strong>Fragment</strong>.</p><p></p><p><strong>LiveData</strong> доставляет данные только наблюдателям, которые находятся в активном состоянии, т.е. тем компонентам, что были подписаны на наш экземпляр <strong>LiveData</strong>. <strong>Observer</strong> входит в активное состояние, когда соответствующий ему <strong>lifecycle</strong> переходит в состояние <strong>STARTED</strong> или <strong>RESUMED</strong>.</p><p></p><p><strong>LiveData</strong> автоматически отписывает наблюдателей, когда их <strong>lifecycle</strong> переходит в состояние <strong>DESTROYED</strong>.</p><p></p><p>У объекта <strong>LiveData</strong> может быть любое количество наблюдателей</p>",
