        {
            "materialId": 12,
            "materialName": "Основные компоненты Android",
            "materialText": "<p>Принято считать, что любое android-приложение состоит из четырех базовых компонентов. Все эти компоненты в случае их использования, необходимо объявлять в манифесте.</p><p></p><p><strong>Activity </strong>-<strong> </strong> представляет UI (пользовательских интерфейс) и функциональность, которые видны непосредственно пользователю.</p><p></p><p><strong>Service</strong> - еще эти компоненты называют &quot;службами&quot;, используются для выполнения затратных по времени операций, в большинстве случаев, работают в фоновом режиме (независимо от приложения), такие компоненты сами по себе не требуют каких-либо действий от пользователя.</p><p></p><p><strong>BroadcastReceiver</strong> - принимает и обрабатывает широковещательные сообщения ивенты, отправленные внутри приложения или из других приложений (своего рода способ коммуникации между разными приложениями).</p><p></p><p><strong>ContentProvider</strong> - используется для обмена данными с другими приложениями (в большинстве случаев используется для получения доступа к файловому хранилищу, чтоб работать с изображениями, видео и прочими файлами на устройстве)</p><p></p><p><strong>Чуть более подробно о каждом из них</strong></p><p></p><p><strong>Activity</strong> — максимально простым языком - это основной экран приложения, который видит пользователь. Во многом благодаря <strong>активити</strong> пользователь видит свой интерфейс, все эти окошки и кнопочки, не без участия <strong>Activity</strong> мы можем выполнять composable-функции или отображать содержимое фрагментов.</p><p></p><p>В процессе переключения между экранами, <strong>экземпляры</strong>(<strong>инстансы</strong>) активити образуют <strong>стек</strong> (некую очередь). Положение в стеке определяет состояние каждого экземпляра.</p><p></p><p><strong>Состояние может быть:</strong></p><p></p><p><strong>Активно</strong> — активити на переднем плане, которая полностью видна.</p><p><strong>Приостановлено</strong> — активити отображается частично.</p><p><strong>Остановлено</strong> — активити не видна. Например, пользователь перешел на другой экран.</p><p><strong>Неактивно</strong> — активити удалена.</p><p></p><p>Состояние определяет системный приоритет приложения, а это влияет напрямую на возможность завершения приложения и на планирование выполнения потоков.</p><p></p><p><strong>Жизненный цикл activity</strong> завершается, когда пользователь возвращается к предыдущему экрану или когда activity вызывает метод <strong>finish()</strong>.</p><p></p><p><strong>Service (сервисы/ службы)</strong> — могут выполнять различную фоновую работу без взаимодействия с пользователем. Часто службы с используют для снятия нагрузки с других компонентов, когда операция длинная и превосходит длительность существования другого компонента. В качестве яркого примера работы сервиса - можно отметить приложение &quot;Навигатор&quot; - служба этого приложения собирает информацию об измении гео-позиционирования пользователя и передает ее в приложение, потому не так важно, свернули мы приложение или оно активно, информация в него всегда поступает, пока служба активна. Сервисы могут работать в двух режимах: <strong>started</strong> и <strong>bound</strong>.</p><p></p><p><strong>Started</strong> - просто запускаем сервис через <strong>context.startService(intent)</strong>, где передаем явный или неявный Intent. Завершаем с помощью <strong>context.stopService(intent)</strong>.</p><p><strong>Bound</strong> - несколько разных компонентов могут подключаться к сервисам через <strong>context.bindService(intent, serviceConnection, flag)</strong>, где мы можем передать <strong>явный или неявный интент</strong>. И только после такого подключения компоненты из той же <strong>Activity</strong> могут взаимодействовать с сервисом через <strong>serviceConnection</strong>, связь с ними можно разорвать с помощью <strong>context.unbindService(serviceConnection)</strong>.</p><p></p><p>Сервис автоматически удаляется, когда последний компонент, который был с ним соединен разорвал связь.</p><p>Службы можно разделить на 2 типа: <strong>Background</strong> и <strong>Foreground</strong> сервисы.</p><p></p><p>По умолчанию любой сервис, не зависимо от того в каком он состоянии находится, будь-то <strong>Started</strong> или <strong>Bound</strong>, является <strong>Background-службой</strong>. Это означает, что сервис работает как фоновая задача (<strong>не путать с фоновым потоком</strong>), не требующая взаимодействия с пользователем.</p><p></p><p><strong>Background Service</strong> – простыми словами, это сервис, который выполняется без уведомления пользователя о состоянии своей работы, в незаметном для пользователя режиме.</p><p></p><p><strong>Foreground Service</strong> – это сервис, о существовании которого пользователь осведомлен - в прямом смысле пользователь видит его, через соответствующую нотификацию в статус-баре.</p><p>Ярким примером такого сервиса может быть какой-нибудь media-player, вы видите его при проигрывании музыки, часто для такого сервиса делают какой-то <strong>ui</strong>, когда можно поставить песню на паузу, остановить или продолжить воспроизведение.</p><p></p><p>Процесс в котором работает <strong>foreground</strong> сервис имеет больший приоритет в сравнении с background сервисом, но это совсем не значит, что он может работать вечно и система его &quot;не убьет&quot;, но шансы такого сервиса куда выше чем у того же бэкграунд-сервиса. В примере с плеером <strong>foreground</strong> сервис выполняет сразу две функции:</p><p>1. Говорит системе, что этот процесс убивать не надо, т.к. пользователь взаимодействует с ним;</p><p>2. Обрабатывает нажатия на кнопки в нотификации.</p><p></p><p>Запущенный сервис может быть переведен в состояние <strong>foreground</strong> методом<strong> startForeground(int id, Notification notification)</strong>, принимающим параметры id нотификации и саму нотификацию, которая будет показана пользователю. Важно знать, что <strong>startForeground()</strong> вызывается у сервиса, который уже запущен как <strong>background</strong> сервис, например методом <strong>startService()</strong>.</p><p></p><p>Для перевода <strong>foreground</strong> сервиса в состояние <strong>background</strong> используется метод <strong>stopForeground(boolean removeNotification)</strong>. Этот метод не останавливает сервис (нужно вызвать <strong>stopService()</strong> или <strong>stopSelf()</strong>, чтобы его завершить вообще), но увеличивает шансы того, что система убьет процесс автоматически, как только потребуется память для чего-тоб более важного по мнению системы.</p><p></p><p><strong>ContentProvider</strong> — полезен и необходим при получении каких-либо данных внутри одного приложения или совместно с другими приложениями. Мы можем получить доступ к любым данным, но обычно <strong>ContentProvider</strong> используется с файловой системой (картинки, фото и прочее) или с базами данных. Т.е. любое приложение может предоставить свои данным другим приложениям, которые работают в других процессах, эти провайдеры необходимы потому, что<strong> все приложения android реализованы как пользователи в Linux</strong>, и просто так один пользователь не имеет доступа к информации других пользователей.</p><p></p><p><strong>BrodcastReceiver</strong> — компонент, который умеет принимать сообщения, что отправляются другими компонентами нашего или чужого приложения, или вообще может принимать сообщения непосредственно от операционной системы Android. Все входящие сообщения фильтруются, чтобы понять, какие именно сообщения нужны именно нам. <strong>Компонент обязательно должен быть зарегистрирован</strong>, это можно сделать или статически в манифесте или программно. А потом, когда необходимость в работе сервиса отпадет, необходимо <strong>отменить регистрацию</strong>, чтобы зря не работал и не расходовал ресурсы системы напрасно. Когда мы <strong>регистриуруем сервис в в манифесте</strong> (статически), то компонент автоматически получает сообщения, пока приложение установлено, что наверное, не всегда оправданно.</p><p></p><p></p><p></p>",
