        {
            "materialId": 11,
            "materialName": "Какой жизненный цикл у фрагмента (Fragment)?",
            "materialText": "<p>Все классы фрагментов наследуются от базового класса Fragment и имеют жизненный цикл немного отличный от Activity, но тем не мене жизненный цикл фрагмента тесно связан с жизненным циклом Activity, ведь само по себе фрагмент не может существовать вне активити.</p><p></p><p>Представить жизненный цикл фрагмента схематично в связке с жизненным циклом активити можно как на изображении ниже.</p><p></p><p><img src=\"data:image/png;base64,\"></p><p></p><p></p><p>Все этапы жизненного цикла фрагмента представлены одной из констант перечисления(enum) Lifecycle.State:</p><p></p><p><strong>INITIALIZED</strong></p><p></p><p><strong>CREATED</strong></p><p></p><p><strong>STARTED</strong></p><p></p><p><strong>RESUMED</strong></p><p></p><p><strong>DESTROYED</strong></p><p></p><p>При создании фрагмент находится в состоянии <strong>INITIALIZED</strong>. Чтобы фрагмент прошел все остальные этапы жизненного цикла, фрагмент необходимо передать в объект <strong>FragmentManager</strong>, который дальше и будет определять или менять состояние фрагмента.</p><p></p><p><strong>onCreate()</strong>: происходит создание фрагмента. В этом методе мы можем получить ранее сохраненное состояние фрагмента через параметр метода <strong>Bundle savedInstanceState</strong>. (Если фрагмент создается первый раз, то этот объект имеет значение null) Этот метод вызывается после вызова соответствующего метода onCreate() у activity.</p><p><span style=\"color: rgb(102, 185, 102);\">public void onCreate(Bundle savedInstanceState)</span></p><p></p><p><strong>onCreateView()</strong>: фрагмент создает представление (View или визуальный интерфейс). В этом методе мы можем установить, какой именно визуальный интерфейс будет использовать фрагмент. При выполнении этого метода представление фрагмента переходит в состояние <strong>INITIALIZED</strong>. А сам фрагмент все еще находится в состоянии <strong>CREATED</strong></p><p><span style=\"color: rgb(102, 185, 102);\">public View onCreateView(LayoutInflater inflater, ViewGroup container, Bundle savedInstanceState)</span></p><p>Первый параметр - объект <strong>LayoutInflater</strong> позволяет получить содержимое ресурса layout и передать его во фрагмент.</p><p>Второй параметр - объект <strong>ViewGroup</strong> представляет контейнер, в которой будет загружаться фрагмент.</p><p>Третий параметр - объект <strong>Bundle</strong> представляет состояние фрагмента. (Если фрагмент загружается первый раз, то равен null)</p><p>На выходе метод возвращает созданное с помощью <strong>LayoutInflater</strong> представление в виде объекта <strong>View</strong> - собственно представление фрагмента</p><p></p><p><strong>onViewCreated()</strong>: вызывается после создания представления фрагмента.</p><p><span style=\"color: rgb(102, 185, 102);\">public void onViewCreated (View view, Bundle savedInstanceState)</span></p><p>Первый параметр - объект <strong>View</strong> - представление фрагмента, которое было создано посредством метода <strong>onCreateView</strong>.</p><p>Второй параметр - объект <strong>Bundle</strong> представляет состояние фрагмента. (Если фрагмент загружается первый раз, то равен null)</p><p></p><p><strong>onViewStateRestored()</strong>: получает состояние представления фрагмента. После выполнения этого метода представление фрагмента переходит в состояние <strong>CREATED</strong></p><p><span style=\"color: rgb(102, 185, 102);\">public void onViewStateRestored (Bundle savedInstanceState)</span></p><p></p><p><strong>onStart()</strong>: вызывается, когда фрагмент становится видимым и вместе с представлением переходит в состояние <strong>STARTED</strong></p><p><span style=\"color: rgb(102, 185, 102);\">public void onStart ()</span></p><p></p><p><strong>onResume()</strong>: вызывается, когда фрагмент становится активным, и пользователь может с ним взаимодействовать. При этом фрагмент и его представление переходят в состояние <strong>RESUMED</strong></p><p><span style=\"color: rgb(102, 185, 102);\">public void onResume ()</span></p><p></p><p><strong>onPause():</strong> фрагмент продолжает оставаться видимым, но уже не активен и вместе с представлением переходит в состояние <strong>STARTED</strong></p><p><span style=\"color: rgb(102, 185, 102);\">public void onPause ()</span></p><p></p><p><strong>onStop()</strong>: фрагмент больше не является видимым и вместе с представлением переходит в состояние <strong>CREATED</strong></p><p><span style=\"color: rgb(102, 185, 102);\">public void onStop ()</span></p><p>На этом этапе жизненного цикла мы можем сохранить состояние фрагмента с помощью метода onSaveInstanceState(). Однако стоит учитывать, что вызов этого метода зависит от версии API. <strong>До API 28 onSaveInstanceState() вызывается до onStop()</strong>, а <strong>начиная API 28 после onStop()</strong>.</p><p></p><p><strong>onDestroyView()</strong>: уничтожается представление фрагмента. Представление переходит в состояние <strong>DESTROYED</strong></p><p></p><p><strong>onDestroy()</strong>: окончательно уничтожение фрагмента - он также переходит в состояние <strong>DESTROYED</strong></p><p></p><p>Дополнительно для фрагмента определено два метода обратного вызова, которые связаны с прикреплением фрагмента к <strong>activity</strong>:</p><p></p><p>Когда фрагмент добавляется в <strong>FragmentManager</strong> и прикрепляется к определенному классу <strong>Activity</strong>, у фрагмента вызывается метод <strong>onAttach</strong>(). Данный метод вызывается до всех остальных методов жизненного цикла. Начиная с этого момента фрагмент становится активным, и <strong>FragmentManager</strong> начинает управлять его жизненным циклом.</p><p></p><p>Метод <strong>onDetach()</strong> вызывается, когда фрагмент удаляется из <strong>FragmentManager</strong> и открепляется от класса <strong>Activity</strong>. Этот метод вызывается после всех остальных методов жизненного цикла.</p><p></p><p></p>",
