            "materialId": 3,
            "materialName": "Кастомные View. Какой жизненный цикл у View в Андроид?",
            "materialText": "<p>Жизненный цикл View в Android связан с различными состояниями, через которые проходит виджет (он же View) в процессе своего существования на экране. Ниже мы представим основные его этапы:</p><p></p><p><strong>Created (Создание)</strong> - View генерируется программно или прогружается из XML-макета. В этот период мы еще ничего не видим на экране.</p><p></p><p><strong>Attached (Присоединение)</strong> - Виджет прикрепляется к родительскому контейнеру (какой-нибудь Layout). Здесь уже начинают формироваться различные параметры для отображения и позиционирования, но мы еще пока ничего на экране не видим.</p><p></p><p><strong>Measured (Измерение)</strong> - Система оценивает и измеряет размеры нашего компонента, проектирует их в отношении родительского контейнера, чтобы в последующем правильно разместить его на экране. Этот этап определяет размеры текущего View и его дочерних элементов.</p><p></p><p><strong>Layout (Расположение)</strong> - Компонент размещается внутри родительского контейнера с учетом замеров, выполненных на предыдущем этапе.</p><p></p><p><strong>Draw (Отрисовка)</strong> - Этап прорисовки компонента, здесь впервые мы начинаем видеть созданный ранее элемент на экране, здесь применяются атрибуты и графические ресурсы.</p><p></p><p><strong>Detached (Отсоединение)</strong> - Наш компонент открепляется от родительского контейнера. Этап наступает при удалении View из иерархии другого списка компонентов или в тех случаях, когда нам нужно временно или постоянно скрыть наш компонент.</p><p></p><p><strong>Destroyed (Уничтожение)</strong> - Компонент уничтожается, данный этап освобождает память и ресурсы, которые были затрачены на отображение компонента. Компонент проходит эту стадию при завершении работы Activity/Фрагмента или в случае явного удаления компонента с нашего экрана.</p><p></p><p>Чтобы лучше разобраться в том, как устроен жизненный цикл, мы покажем это на схеме ниже, эта информация поможет разработчику более гибко и правильно управлять ресурсами, обновлять интерфейс и обрабатывать события и совершать другие действия с компонентом.</p><p></p><p><img src=\"data:image/png;base64,\"></p><p></p>",
