            "materialId": 4,
            "materialName": "Что такое Activity, каков eё жизненный цикл?",
            "materialText": "<p>Activity — это основная часть любого Android приложения, с которой взаимодействует пользователь. То есть, это сам интерфейс или экран, на котором происходит взаимодействие в определенном состоянии.</p><p></p><p><strong>Как выглядит код Activity:</strong></p><p></p><p><span style=\"color: rgb(102, 185, 102);\">public class MainActivity extends AppCompatActivity {</span></p><p><span style=\"color: rgb(102, 185, 102);\"> // содержимое класса </span></p><p><span style=\"color: rgb(102, 185, 102);\">}</span></p><p></p><p><strong>Жизненный цикл Activity / Приложения</strong></p><p></p><p><img src=\"data:image/png;base64,\"></p><p></p><p>Когда activity переходит из одного состояния в другое, система <strong>Android</strong> делает вызов методов (<strong>callback</strong>) обратного жизненного цикла <strong>activity</strong>, и параллельно генерирует уведомление о конкретной стадии после каждого действия. Например:</p><p></p><p>* <strong>OnCreate()</strong>. Вызывается при создании activity. В нем появляется интерфейс, код самого макета, кнопки и другие функциональные элементы формы.</p><p></p><p>* <strong>OnStart().</strong> Вызывается при появлении activity на экране.</p><p></p><p>* <strong>OnResume()</strong>. Activity на экране, с ним можно взаимодействовать, оно в фокусе.</p><p></p><p>* <strong>OnPause()</strong>. Само приложение activity находится в состоянии паузы, не в фокусе. С ним нельзя взаимодействовать, но частично можно видеть на экране. Например, в виде диалогового окна, под другим <strong>activity</strong>.</p><p></p><p>* <strong>OnStop()</strong>. В этом методе activity переходит в состояние <strong>Stopped</strong>, то есть полностью невидима. В методе <strong>onStop</strong> следует освобождать используемые ресурсы, которые не нужны пользователю, когда он не взаимодействует с <strong>activity</strong>. При этом в памяти устройства остаются все элементы интерфейса, с которыми в дальнейшем можно взаимодействовать. Например, в случае, если в поле приложения был введен текст в момент когда <strong>activity</strong> было в статусе <strong>OnResume()</strong>, а затем активити было переведено в статус <strong>OnStop()</strong> и обратно в <strong>OnResume()</strong>, введенный текст сохранится.</p><p></p><p>*<strong> onDestroy().</strong> Завершение работы activity происходит посредством вызова метода <strong>onDestroy</strong>, который возникает или при вызове <strong>finish()</strong>, или если система решит убить <strong>activity</strong> в силу конфигурационных причин (например, поворот экрана или при многооконном режиме).</p><p></p><p>При необходимости смены одного состояния на другое, вы можете вызывать соответствующие методы, которые вернут вам коллбэк с нужным состоянием, например:</p><p></p><p><strong>onDestroy()</strong></p><p></p><p></p><p>Когда ваша <strong>activity</strong> возвращается на первый план из остановленного состояния, она получает вызов <strong>onRestart()</strong>. Система также вызывает <strong>onStart()</strong> метод, который происходит каждый раз, когда ваша <strong>activity</strong> становится видимой пользователю (будь то перезапуск или объект создан впервые).<strong> onRestart() </strong>метод, однако, вызывается только когда activity возобновляется из остановленного состояния, так что вы можете использовать его для выполнения специальных реставрационных работ, которые могут быть необходимы, только если <strong>activity</strong> была ранее остановлена, но не уничтожена.</p>",
