            "materialId": 10,
            "materialName": "Что такое расширения (extensions) в Kotlin?",
            "materialText": "<p>Функции-расширения или extensions в Kotlin позволяют дополнять существующие методы класса путём добавления нового функционала, при этом необходимость наследоваться от такого класса пропадает. Нет также и необходимости в использования паттернов вроде <strong>Decorator</strong>. Это реализовано с помощью специальных выражений, называемых в <strong>Kotlin</strong> <strong>расширения</strong>.</p><p></p><p>Предположим, ты можешь написать новые функции для класса из сторонней библиотеки, доступа к изменению которой просто нет. Такие функции можно вызывать обычным способом, как если бы они были методами исходного класса. Кроме функций расширения существуют также и свойства расширения, которые позволяют определять новые свойства для существующих классов.</p><p></p><p><strong>Пример</strong></p><p></p><p>Представим у нас есть необходимость регулярно работать со строкой даты, и выводить вместо числа название месяца, такая функция расширения для строки может выглядеть так:</p><p></p><p><span style=\"color: rgb(102, 185, 102);\">fun String.getNameMonth(stringDate: String): String {</span></p><p><span style=\"color: rgb(102, 185, 102);\"> val splittedDate = stringDate.split(&quot;.&quot;)</span></p><p><span style=\"color: rgb(102, 185, 102);\"> return when(splittedDate[1]){</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;01&quot;-&gt; &quot;январь&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;02&quot;-&gt; &quot;февраль&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;03&quot;-&gt; &quot;март&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;04&quot;-&gt; &quot;апрель&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;05&quot;-&gt; &quot;май&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;06&quot;-&gt; &quot;июня&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;07&quot;-&gt; &quot;июль&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;08&quot;-&gt; &quot;август&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;09&quot;-&gt; &quot;сентябрь&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;10&quot;-&gt; &quot;октябрь&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;11&quot;-&gt; &quot;ноябрь&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\"> &quot;12&quot;-&gt; &quot;декабрь&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\">}</span></p><p></p><p><strong>Как этим воспользоваться? </strong></p><p></p><p><span style=\"color: rgb(102, 185, 102);\">val date = &quot;11.01.1990&quot;</span></p><p><span style=\"color: rgb(102, 185, 102);\">date. getNameMonth()</span></p><p>На выходе получим: &quot;январь&quot;</p><p></p><p></p><p><strong>Расширения</strong> на самом деле не проводят никаких модификаций с классами, которые они расширяют. Под капотом расширение, создает новую функцию, а не новый член класса. При компиляции в <strong>Java</strong>, мы получаем обыкновенные<strong> public static методы</strong>.</p><p></p><p>Расширения имеют статическую диспетчеризацию: это значит, что вызванная функция-расширение определяется типом её выражения, из которого она вызвана, а не типом выражения, вычисленным в ходе выполнения программы, как при вызове виртуальных (обычных) функций.</p><p></p><p>Обрати внимание еще и на то, что расширения могут быть объявлены для <strong>null-допустимых типов</strong>. Такие расширения могут ссылаться на переменные объекта, даже если значение переменной равно null и есть возможность провести проверку<strong> this == null</strong> внутри тела нашей функции.</p><p></p><p>Благодаря этому метод <strong>toString()</strong> в <strong>Kotlin</strong> вызывается без проверки на null: она проходит внутри функции-расширения.</p><p></p><p><strong>Примечание о видимости</strong></p><p>Расширения используют те же модификаторы видимости как и обычные функции, объявленные в той же области видимости. Например:</p><p></p><p>Расширение, объявленное на верхнем уровне файла, имеет доступ к другим private объявлениям верхнего уровня в том же файле;</p><p>Если расширение объявлено вне своего типа принимателя, оно не может получить доступ к <strong>private</strong> или <strong>protected</strong> членам принимателя.</p>",
