            "materialId": 9,
            "materialName": "Что такое Data Class в Kotlin?",
            "materialText": "<p>Data Class в языке Kotlin необходим для хранения данных. В этом то и заключается его ключевая и пожалуй, единственная роль. По сути Data Class - является структурой для описания модели. Функционал и некоторые служебные функции таких классов зависят непосредственно от данных, что в них располагаются.</p><p></p><p><strong>Как это может выглядеть?</strong></p><p></p><p><span style=\"color: rgb(102, 185, 102);\">data class UserCompany(</span></p><p><span style=\"color: rgb(102, 185, 102);\">val name: String, </span></p><p><span style=\"color: rgb(102, 185, 102);\">val age: Int</span></p><p><span style=\"color: rgb(102, 185, 102);\">val salary: Int)</span></p><p></p><p>Кроме того у любого <strong>Data Class</strong> есть базовые функции:</p><p><strong>equals() </strong>/<strong> hashCode()</strong>, <strong>toString()</strong>, <strong>copy()</strong>,<strong> </strong>так называемые <strong>компонентные функции componentN()</strong>, которые соответствуют свойствам, в соответствии с порядком их объявления.</p><p></p><p><strong>Обязательные требования к Data Class:</strong></p><p></p><ul><li><em>Базовый конструктор должен иметь как минимум один параметр;</em></li></ul><p></p><ul><li><em>Классы данных не могут быть абстрактными, open, sealed или inner.</em></li></ul><p></p><p></p><p><strong>При наследовании необходимо учитывать следующее:</strong></p><p></p><p>Если существуют явные (собственные) реализации <strong>equals()</strong>, <strong>hashCode()</strong> или <strong>toString()</strong> в теле класса данных или final реализации в суперклассе, то эти функции не генерируются компилятором автоматически, в этом случае будут использоваться объявленные вами реализации данных функций.</p><p></p><p>Если суперкласс включает функции <strong>componentN()</strong>, которые являются открытыми и возвращают совместимые типы, соответствующие компонентные функции создаются для класса данных и <strong>переопределяют функции суперкласса</strong>. Если функции суперкласса не могут быть переопределены из-за несовместимости сигнатур или потому что они помечены модификатором <strong>final</strong> - ты получишь ошибку.</p><p>Предоставление явных реализаций для функций <strong>componentN()</strong> и <strong>copy()</strong> не допускается - эти функции должны быть определены и реализованы компилятором.</p><p></p><p>Классы данных могут расширять другие классы).</p><p></p><p>Важно понимать, что сравнивая 2 экземпляра <strong>Data Class</strong> - сравниваются не их значения а ссылки на них в памяти. Потому то и сравнивая 2 одинаковых экземпляра с помощью <strong>equals()</strong> вы всегда будете получать <strong>false</strong>.</p><p></p><p>Еще одна интересная функция из арсенала Data классов – <strong>copy()</strong>. Во-первых – она умеет копировать объекты целиком, а еще этот метод умеет копировать объекты с выборочным изменением полей.</p><p></p><p><strong>hashCode()</strong> - такой метод есть во всех разновидностях классов, но в Data классе он переопределен, а значит имеет другую реализацию. Метод возвращает уникальный код объекта. Он также может использоваться для сравнения, как и equals(), но работает быстрее. Потому, что два числа сравнивать быстрее, чем все свойства и значения объекта. Если два объекта Data класса имеют одинаковые свойства, то и хэш-код у них будет одинаковый.</p><p></p><p></p><p>Интересный факт</p><p></p><p>Стандартная языковая библиотека <strong>Kotlin</strong> уже содержит несколько классов типа Data, они представлены классами <strong>Pair</strong> и <strong>Triple</strong>. Вот-только на практике их почти никогда не используют, ведь собственные , именованные классы данных являются лучшим решением, так-как делают код понятным и читабельным.</p>",
