            "materialId": 54,
            "materialName": "С какой технической проблемой вы недавно столкнулись и как вы ее решили?",
            "materialText": "<p>Правильного ответа на данный вопрос не существует, но ответить на вопрос придется, поэтому постарайся подготовить ответ на данный вопрос заранее. Если таковой ситуации не случалось, следует просто придумать, а также ее решение. или Говорить следует только о технических ошибках. Не следует выбирать проблемы, связанные с твоими личными качествами и недостатками. «Это случилось потому, что я проспал» - такие вещи говорить не стоит.</p><p></p><p>Задача о которой ты собираешься рассказать не должна быть простой. В противном случае сверху накинут вопрос в роде - «почему у вас вызвала трудности такая простая задача?». Но тут еще стоит учитывать, что на скрининге может быть человек с техническим бэкграундом, он может попытаться раскритиковать твой способ решения сложной задачи. Поэтому лучше выбрать средненькую задачу по сложности.</p>",
