        {
            "materialId": 55,
            "materialName": "Ваш последний проект: чем вы занимались, за что отвечали?",
            "materialText": "<p>Правильно ответа нет и здесь, да и вообще правильных ответов на &quot;классические HR вопросы не существует&quot;, Здесь в болшей степени оценивают твои Soft-скиллы. Тем не менее к этому вопросу следует подготовиться заранее, дабы не создавать &quot;утомительных пауз&quot;, и не подвергать твои софты сомнению. Расскажите о самом наполненном и сложном проекте. Будет идеально если то, о чем ты собираешься рассказать релевантно или максимально близко тому, что тебе предстоит делать на будущей работе. Самое главное в твоем рассказе - структура. Для такого рода вопросов можно использовать методику <strong>STAR</strong>.</p><p></p><p><strong>S</strong> — Situation - ситуация: расскажи о задаче, которая стояла перед тобой, о проекте, о компании, в которой ты работал</p><p><strong>T</strong> — Target - цель: опиши цель, к которой должно было привести решение поставленной задачи</p><p><strong>A</strong> — Action - действие: опиши свои действия для достижения цели</p><p><strong>R</strong> — Result - результат: расскажи о достигнутых результатах.</p><p>Не стоит использовать субъективных эпитеты вроде «успешно», «эффективно». Лучше всего результат выглядит в цифрах, например: «скорость загрузки главной страницы сайта ускорилась на 10%» или «благодаря этому решению, мы смогли запустить на 3 проекта больше».</p><p></p><p>Если ты начинающий специалист и не можешь ничего такого припомнить, погугли проблемные ситуации в своей сфере и почитай как люди их решали, расскажи аналогичную ситуацию на скрининге. Либо поинтересуйся у друзей, которые уже работают в этой сфере. В крайнем случае всегда можно спросить в нашем чате.</p>",
