            "materialId": 56,
            "materialName": "Как вы сейчас оцениваете свой грейд?",
            "materialText": "<p>Уровень IT-специалистов определяется объемом его опыта и навыков. Большинство компаний руководствуются 3 грейдами:</p><p></p><ul><li><strong>Джун</strong> (junior) - младший специалист, работающий и обучающийся под руководством более опытных специалистов</li><li><strong>Мидл</strong> (middle) - самостоятельный специалист, может выполнить практически любую задачу самостоятельно, крайне редко нуждается в помощи коллег</li><li><strong>Синьор</strong> (senior) - специалист с высоким уровнем экспертизы, имеющий богатый опыт работы и обучающий младших коллег.</li></ul><p></p><p>В отдельных компаниях эти же грейды могут называться несколько иначе, допустим &quot;младший специалист&quot;, &quot;специалист&quot;, &quot;старший специалист&quot;, но суть остается той же.</p><p>Иногда можно встретить грейд &quot;<strong>trainee</strong>&quot;, он же стажер, но нам такое не подходит, их почти никто не берет на работу, да и требований к ним фактически никаких не предъявляют.</p><p>Грубо говоря грейд - это опыт и сфера ответственности. От уровня специалиста зависят задачи, которые ему будут назначать.</p><p></p><p>Нередко к каждому из этих грейдов добавляют дополнительные параметры, например, &quot;миддл+&quot; - это еще не синьор, но уже и не просто &quot;миддл&quot;. Встречаются и компании у которых на каждый грейд 3 уровня, вроде &quot;M1&quot;, &quot;M2&quot;, &quot;M3&quot; - где все три позиции это &quot;миддл&quot;, но чем выше цифра - тем он выше ценится.</p><p></p><p>Все эти грейды не имеют строгих границ. Их применение в рамках компаний - весьма субъективная штука. Многие компании и вовсе используют собственные системы классификаций.</p><p></p><p>Более или менее внятные компании для определения сильных и слабых сторон своих сотрудников используют &quot;<strong>карты компетенций</strong>&quot; и оценивают каждый навык отдельно по собственной шкале. </p><p></p><p>Бывает, что на предыдущей работе мы занимаем позицию грейда, например, &quot;мидл+&quot;. Но на новой работе вас нарекли джуном. Это вовсе не значит, что  мы унижены, как профессионалы. Просто на новой работе - другая система оценки. </p><p></p><p>Отвечая на этот вопрос, нужно постараться не давать прямых ответов. Предложи компании оценить тебя на техническом собеседовании, согласно их собственному грейду. Но если рекрутер не сдается, просто сообщите свой грейд на предыдущем месте и обозначь задачи, которые были в твоей сфере ответственности, избегая деталей.</p>",
