            "materialId": 57,
            "materialName": "Чем вас зацепила наша вакансия?",
            "materialText": "<p>Подготавливая ответ на данный вопрос, важно внимательно ознакомиться с вакансией на которую ты откликаешься. Первым делом вычисляем то, чем больше всего гордится компания. Интересными проектами? Тем, что они уже более 10 лет на рынке? В своей работе используют передовых технологии? Постарайтесь найти 3-4 пункта, перефразируйте, включите лесть и верните информацию из их же вакансии обратно рекрутеру.</p><p></p><p>Старайтесь не переигрывать, опытный рекрутер в 2 счета распознает твою неискренность. Если работа подразумевает офис, можно упомянуть симпатию к району, в котором находится компания, можно отметить положительно какой-нибудь ДМС (хотя он сейчас есть практически везде), любовь к деньгам и корпоративам лучше не показывать.</p><p></p><p>Важно отметить, что не стоит выбирать компании, которые заведомо тебе не нравятся, работа там не сделает тебя счастливее, даже если кажется, что благодаря ей ты станешь сильно богаче.</p>",
