            "materialId": 58,
            "materialName": "Какой формат работы предпочтителен для вас?",
            "materialText": "<p>Будет лучше если ты изначально не будешь откликаться на все подряд, а будешь хотябы немного времени уделять информации в описании к вакансии. В идеальном варианте, тебе вообще не потребуется отвечать на этот вопрос. Однако бывают вакансии где этот пункт не указан, или предусмотрены различные варианты. Здесь стоит отталкиваться от своих личных предпочтений. Если вакансия подразумевает выбор - честно озвучивай, какой вариант для тебя предпочтительнее. Бывает и так, что вакансия допускает удаленную работу, но испытательный срок проходит в офисе - не спеши отказываться, это довольно распространенная практика в компаниях. Если ты начинающий специалист, то скорее наоборот работа из офиса будет для твоей карьеры плюсом, особенно если в офисе присутствуют специалисты аналогичного с тобой профиля. Порой переговорить с глазу на глаз куда эффективнее десятка созвонов.</p>",
