        {
            "materialId": 59,
            "materialName": "На какой уровень заработной даты вы претендуете сейчас?",
            "materialText": "<p>Без сомнения один из самых важнейших вопросов в современных реалиях. Как бы &quot;Кадры&quot; и &quot;Руководители&quot; тебе не рассказывали о том, что деньги - плохой мотиватор, все это ерунда. По сути это единственно возможная причина по которой стоит выполнять для компании работу. Это очень важный вопрос и лучше здесь не прогибаться. Очень часто работодатель не указывает в вакансии зарплатную вилку, мы часто видим, что-то вроде - &quot;Оклад / Зарплата по результатам собеседования&quot;, однако в большинстве случаев этот вопрос задают прямо на &quot;<strong>скрининге</strong>&quot;, еще до прохождения тобой &quot;технического интервью&quot; (если твоя должность такое предполагает).</p><p></p><p>Почти никогда не работает встречный вопрос в стиле - &quot;А какая вилка у компании&quot;? - большинство рекрутеров на него не отвечает, даже если ответ им известен, нетрудно догадаться почему. В случае если тебе повезет, тебе озвучат сумму - можешь скорректировать свои ожидания и назвать нечто похожее рекрутеру.  </p><p></p><p>В случае если рекрутер насчет &quot;зарплатной вилки&quot; увиливает от ответа, лучше подготовиться к вопросу заранее и проверить следующие вещи:</p><p></p><ol><li>Средняя цена на рынке, просто погугли или посмотрите на том же hh, какие зарплаты указывают другие работодателя на схожую с желаемой тобой позицию.</li><li>Зарплата должна быть однозначно выше той, что ты получал на предыдущем месте работы. Часто бывает так, что со сменой работы можно увеличить зарплату чуть ли не вдвое,  выполняя +- все те же задачи.</li></ol><p></p><p>Важно:  Даже если ты уже в отчаянии и можешь согласиться почти на любую зарплату, помни! Слишком низкие зарплатные ожидания - красный флаг! Рекрутеры не относятся всерьез к тем соискателям, что просят зарплату сильно ниже рынка, так как это весьма серьезный повод задуматься о твоих компетенциях, просишь мало - значит не уверен в себе, не уверен в себе - значит где-то на других вопросах ты был не до конца откровенен.</p><p></p><p>*Совет:  Если уж работодатель озвучил вилку и такая зарплата тебя устраивает, ты можешь накинуть процентов 10-15 сверху и обозначить как желаемую, но отметить, что в общем и целом данная компания тебе нравится и ты готов несколько поумерить свои аппетиты дабы поработать в ней (нужно будет придумать пару причин заранее, чтобы это выглядело естественно). В этом случае в глазах работодателя у тебя будет пару дополнительных очков, так как они будут видеть в тебе дополнительную ценность. Каждому работодателю хочется получить специалиста покомпетентнее и подешевле, а тут ты им делаешь скидку.</p>",
