            "materialText": "<p>Весьма сомнительный вопрос в современных реалиях. И уж тем более странный в сфере IT, где порой нам, чтобы повысить себе грейд или зарплату приходится менять компанию. Вообще для сферы IT (среди рядовых специалистов) считается нормальной практикой менять работу раз в год или раз в несколько лет. Другое дело, что работодатель не одобряет такой подход,  поэтому если вы не начинающий специалист, придется немного лукавить. </p><p></p><p>Можно упомянуть следующее: </p><p></p><p>«Технологии развиваются так быстро, что для меня оптимальный шаг планирования - год / полтора».</p><p>Сообщите о планах изучать новые технологии, проявите свое профессиональное любопытство. Но не выходите за рамки стека, который предлагает компания. Например, не стоит говорить о том, что через несколько лет ты планируешь занять руководящую должность, даже если это входит в твои планы. Работодатель высоко ценит &quot;рабочих лошадок&quot;, а потому, в случае если ты джун или миддл, стоит упомянуть о том, что хотел бы расти в этой компании (важно отметить, что именно в этой компании) и в последующем стать синьором. Если ты синьор, скажи, что хотел бы вырасти до лида или техлида, в далекой перспективе до архитектора (если речь про разработку), с другими направлениями по аналогии, указывайте на 1-2 позиции вверх, но не злоупотребляйте. Расскажи о том, что очень любишь свое ремесло и хочешь развивать свои профессиональные компетенции еще глубже. Почему-то исторически сложилось, что работодатель не очень любит карьеристов, а потому следует избегать формулировок с претензией на руководящие позиции.</p>",
