            "materialId": 23,
            "materialName": "Что такое блокировки?",
            "materialText": "<p>В программировании блокировкой называют механизм синхронизации, который позволяет обеспечить исключительный доступ к разделяемому ресурсу между несколькими потоками. Блокировка является одним из методов обеспечения политики управления распараллеливанием.</p><p></p><p><strong>Типы блокировок</strong></p><p></p><p>В большинстве случаев используется так называемая &quot;<strong>мягкая блокировка</strong>&quot;, при этом предполагается, что каждый отдельно взятый поток пытается получить блокировку перед доступом к соответствующему общему ресурсу. В некоторых системах предоставляется механизм обязательной блокировки, при его использовании попытка несанкционированного доступа (пока ресурс используется другим потоком) к заблокированному ресурсу будет прервана через создание исключения в потоке, который пытался получить доступ.</p><p></p><p><strong>Семафор</strong> — считается самым простым типом блокировки. В плане доступа к данным нет никаких различий между режимами доступа: <strong>общим</strong> (только чтение) или <strong>эксклюзивным</strong> (чтение и запись). В режиме <strong>общего доступа</strong> несколько потоков могут запросить блокировку для доступа к данным в режиме «только чтение». <strong>Эксклюзивный режим доступа</strong> в алгоритмах обновления и удаления.</p><p></p><p><strong>Типы блокировок различают по стратегии блокировки</strong> продолжения исполнения потока. В большинстве реализаций запрос блокировки препятствует дальнейшему исполнению потока, пока не появится доступ к заблокированному ресурсу.</p><p></p><p><strong>Спинлок</strong> — блокировка, которая ожидает в цикле, пока не появится доступ. Считается очень эффективной, если поток ожидает блокировку незначительный интервал времени, это позволит избежать избыточной перепланировки потоков. Затраты на ожидание доступа будут значительными при длительном удержании блокировки одним из потоков.</p><p></p><p>Для эффективной реализации механизма блокировки <strong>требуется поддержка аппаратного уровня</strong>. Аппаратная поддержка может быть реализована в виде одной или нескольких <strong>атомарных операций</strong>, таких как «test-and-set», «fetch-and-add» или «compare-and-swap». Такие подходы позволяют без прерываний проверить, свободна ли блокировка и, если это так, занять её.</p><p></p><p>В случаях с однопроцессорными системами присутствует возможность исполнять такие инструкции без аппаратных прерываний при помощи специальных инструкций или <strong>префиксов инструкции</strong>, которые временно отключают прерывания, однако это исключающий подход в многопроцессорных системах с общей памятью (там это просто не работает). Полная поддержка блокировок в многопроцессорном окружении может потребовать достаточно сложной аппаратной и программной поддержки со значительными проблемами синхронизации.</p>",
